import React, { Component } from 'react';
import AppBar from '@material-ui/core/AppBar'
import './App.css';

class App extends Component {
  render(){
    return(
      <div>
        <AppBar color ="primary" position = "fixed">
          <h1>My header</h1>
        </AppBar>
      </div>
    )
  }
}

export default App;
